import { useState, useContext } from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import context from './usecontext';

const Checkout = () => {
  const [name, setname] = useState('');
  const [email, setemail] = useState('');
  const [mobile, setmobile] = useState('');
  const [address, setaddress] = useState('');
  const [cash, setcash] = useState('');
  const { orderid } = useContext(context);
  const navigate = useNavigate();
    const location = useLocation();
    
  const checkout = async () => {
    // Basic validation
    if (!name || !email || !mobile || !address || !cash ) {
      alert("Please fill all fields properly.");
      return;
    }
     const { totalPrice } = location.state || {};

    const data = { name, email, mobile, address, cash, orderid };

    try {
      const res = await fetch("http://localhost:9000/api/checkcartdata", {
        method: "POST",
        body: JSON.stringify(data),
        headers: {
          'Content-Type': 'application/json'
        }
      });

      const result = await res.json();
      if (result.statuscode === 1) {
        alert("Data saved successfully");
        navigate({
          pathname:( "/deliveryaddress", { state: { name, mobile, address, totalPrice,cash,email } }),
          search: `?id=${orderid}`,
        });
      } else {
        alert("Data not saved. Try again.");
      }
    } catch (err) {
      console.error("Checkout Error:", err);
      alert("Server error. Please try again later.");
    }
  };

  return (
    <div>
      <div className="breadcrumb-section">
        <div className="container">
          <h2>Checkout</h2>
        </div>
      </div>

      <section className="login-page section-b-space">
        <div className="container">
          <h3>Checkout</h3>
          <div className="theme-card">
            <div className="theme-form">
              <div className="row">
                <div className="col-md-6">
                  <div className="form-box">
                    <label>Name</label>
                    <input type="text" className="form-control" placeholder="Name"
                      value={name} onChange={(e) => setname(e.target.value)} />
                  </div>
                </div>
                <div className="col-md-6">
                  <div className="form-box">
                    <label>Email</label>
                    <input type="email" className="form-control" placeholder="Email"
                      value={email} onChange={(e) => setemail(e.target.value)} />
                  </div>
                </div>
                <div className="col-md-6">
                  <div className="form-box">
                    <label>Mobile No.</label>
                    <input type="text" className="form-control" placeholder="Mobile No."
                      value={mobile} onChange={(e) => setmobile(e.target.value)} />
                  </div>
                </div>
                <div className="col-md-6">
                  <div className="form-box">
                    <label>Address</label>
                    <textarea className="form-control" style={{ height: "100px" }}
                      value={address} onChange={(e) => setaddress(e.target.value)}></textarea>
                  </div>
                </div>
                <div className="col-md-6">
                  <div className="form-box">
                    <p>totalPrice{totalPrice}</p>
                    <label>Payment Methods</label>
                    <select className="form-control" value={cash} onChange={(e) => setcash(e.target.value)}>
                      <option value="">Choose Method</option>
                      <option value="Cash On Delivery">Cash On Delivery</option>
                      <option value="Payment Online">Payment Online</option>
                    </select>
                  </div>
                </div>
                <div className="col-12">
                  <button className="btn btn-solid w-auto" style={{ marginTop: "20px" }} onClick={checkout}>
                    Checkout
                  </button>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Checkout;
